import React from "react";
import { Card,Image } from "react-bootstrap";
import default_awatar from "../img/defaut_awatar.jpg"

const UserPage = () => {
    return (
        <Card
            style={{borderRadius: 20}}
        >
            <Image
                style={{margin: 20}}
                src = {default_awatar}
                width={400}
                height={400}
            ></Image>
        </Card>
    );
};

export default UserPage;
